import React from "react";
import phone from "../assets/images/phone.png";
function Footer() {
  return (
    <footer id="contact">
      <img src={phone} alt="phone" />
      <img src="./assets/images/WhatsApp_Logo_7.png" alt="whatsapp" />
      <a href="mailto:kobybanks@gmail.com">
        <img src="./assets/images/gmail-icon-38472.png" alt="gmail logo" />
      </a>
      <a href="https://linkedin.com" rel="noreferrer" target="_blank">
        <img src="../../assets/images/LI-In-Bug.png" alt="linkedin logo" />
      </a>
      <a href="https://github.com/Jacob-Banks" rel="noreferrer" target="_blank">
        <img
          src="../assets/images/GitHub-Mark-120px-plus.png"
          alt="github logo"
        />
      </a>
    </footer>
  );
}
export default Footer;
